package com.bloxbean.cardano.yaci.core.protocol.chainsync.serializers;

import com.bloxbean.cardano.yaci.core.util.HexUtil;
import lombok.extern.slf4j.Slf4j;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

@Slf4j
class LocalRollForwardSerializerTest {

    @Test
    public void serde() {
        var hexBytes = "";
        var expectedBytes = HexUtil.decodeHexString(hexBytes);
        var localRollForward = LocalRollForwardSerializer.INSTANCE.deserialize(expectedBytes);
        log.info("block: {}", localRollForward.getTip().getBlock());
        log.info("point: {}", localRollForward.getTip().getPoint());
        assertNotNull(localRollForward);

        var actualBytes = LocalRollForwardSerializer.INSTANCE.serialize(localRollForward);
        assertEquals(expectedBytes, actualBytes);
    }

}